import React from 'react';
//import axios from "axios";

async function getArchive(credentials) {
    return fetch('http://localhost:3001/getarchive', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(credentials)
    })
      .then(data => data.json())
}

async function deleteArchive(credentials) {
    return fetch('http://localhost:3001/deletearchive', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(credentials)
    })
      .then(data => data.json())
}

export default class ArchivePage extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            archives:[],
            archiveId:"",
        };
    }

    componentDidMount() {
        fetch('/listarchives')
          .then(response => response.json())
          .then(json => this.setState({ archives: json }));
      }

    handleGetArchiveSubmit = async e => {
        e.preventDefault();
        const token = await getArchive({
          archiveId
        });
        setToken(token);
      }

      handleDeleteArchiveSubmit = async e => {
        e.preventDefault();
        const token = await loginUser({
          archiveId
        });
        setToken(token);
      }


    render() {

        return(
            <div>
                <h1>Past Archives: </h1>

                <form onSubmit={handleGetArchiveSubmit}>
                    <label>
                    <p>Get Archive</p>
                    <input type="text" onChange={e => setgetArchiveId(e.target.value)} />
                    </label>
                    <button type="submit">Submit</button>
                </form>
                <p></p>
                <form onSubmit={handleDeleteArchiveSubmit}>
                    <label>
                    <p>Delete Archive</p>
                    <input type="text" onChange={e => setdeleteArchiveId(e.target.value)} />
                    </label>
                    <button type="submit">Submit</button>
                </form>

                {
                this.state.archives.length === 0
                    ? 'Loading users...'
                    : 
                    this.state.archives.map(archive => (
                        <table class="table table-striped">

                            <tbody>
                                <tr>
                                    <td><b>Name: </b>{archive.name || "Untitled"}</td>
                                    <td><b>Time: </b>{archive.duration} seconds</td>
                                    <td><b>Status: </b>{archive.status}</td>
                                    <td><b>Archive ID: </b> {archive.id}</td>

                                </tr>
                            </tbody>
                        </table>

                    ))
                }

            </div>
        )
    };
};
